        <SafeAreaView style = {css.fundo}>
            <View> <Text>{result}<Text></Text></Text></View>
            <Table borderStyle = {{borderWidth: 1}}>
                <Row data = {Valores.tableHead}/>
                <Row data = {Valores.tableBody}/>

            </Table>
        </SafeAreaView>
    );
    
}
